import React from "react";
import { useSelector } from "react-redux";
import SinglePokemon from "./SinglePokemon";

export default function PokemonList() {
  const pokemons = useSelector((state) => state.pokemonAddSlice.pokemonList);
  const pokemonsTodisplayLi = pokemons.map((pokemon) => (
    <SinglePokemon
      key={pokemon.id}
      type={pokemon.types[0].type.name}
      name={pokemon.name}
      sprite={pokemon.sprites.back_default}
    >
      {" "}
    </SinglePokemon>
  ));
  return <ul> {pokemonsTodisplayLi} </ul>;
}
